import React, { useEffect, useContext } from "react";
import { Typography, Button, Input, TextField, FormGroup, FormControlLabel } from "@material-ui/core";
import axios from "axios";

import { Context } from "../Context";
import Navbar from "../Navbar";
import useStyles from "../styles";
import { Container } from "@material-ui/core";

function EditAccount() {

  const {
    accountState,
    getAccountInfo
  } = useContext(Context);

  // All possible account info categories for 3 types of users
  const {
    acc_id,
    branch_id,
    employee_id,
    email,
    username,
    first_name,
    last_name,
    hp,
    mgr_id,
    role_id,
    store_id,
    type_id,
  } = accountState;

  useEffect(() => {
    getAccountInfo();
  }, []);

  const styles = useStyles();

  return (
    <main className={styles.main}>
      <Typography variant="h3" align="center">Edit Account</Typography>
      <br />
      <FormGroup column="true">
        <TextField label="User Name" defaultValue={username} />
        <TextField label="First Name" defaultValue={first_name} />
        <TextField label="Last Name" defaultValue={last_name}/>
      </FormGroup>
    </main>
  )
}

export default EditAccount;
